import * as React from 'react';
import CircularProgress from '@mui/material/CircularProgress';
import Box from '@mui/material/Box';

export default function Loader({loading}) {
    return loading ? 
    <div className="loader">
        <Box sx={{ display: 'flex' }}>
        <CircularProgress />
    </Box>
    </div> : null;
}
